import React from "react";
import "./banner.css";
import Nav from "./navbar/nav";
import { BanneData } from "../../../Appdata";
const Banner = () => {
  return (
    <>
      <div className="banner" id="home">
        <Nav />
        <div className="banner-heading">
          <h1>
            {Banner[0].h1} <span> {Banner[0].span}</span>
          </h1>
          <div className="para">
            <p>
              That Are Specifically Tailored
              <br />
              To meet your business requirements
            </p>
          </div>
          <button className="primary-btn discover">Discover</button>
        </div>
      </div>
    </>
  );
};
export default Banner;
